// src/pages/Login.js
import React from 'react';

const Login = () => {
    return (
        <div>
            <img src="/images/login.png" alt="Login" className="page-image" />
            <h1>Login</h1>
            <form>
                <label>
                    Email:
                    <input type="email" name="email" />
                </label>
                <br />
                <label>
                    Password:
                    <input type="password" name="password" />
                </label>
                <br />
                <button type="submit">Login</button>
            </form>
        </div>
    );
};

export default Login;
